import React from "react";
import notes from '../notes'

function createNote(data) {
  return  <Note
    key={data.key}
    title={data.title}
    content={data.content}
  />

}

function Note() {
  return (
    <div className="note">
      <h1>notes.crea</h1>
      <p>This is the note content</p>
    </div>
  );
}

export default Note;
